import Head from 'next/head';
const Layout = (props) => (
    <div>
        <Head>
            <title>listing -page</title>
            <link href="https://stackpath.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" />
        </Head>
          {props.children}
    </div>
)
export default Layout;
